<?php    function DisablePacketEncryption($exe) {        if ($exe === true) {            return new xPatch(61, 'Disable Packet Encryption', 'UI', 0, 'Disable kRO Packet_ID Encryption.');        }        		if ($exe->clientdate() <= 20130605) {			$code =  "\x8B\x41\x08"			// MOV EAX,DWORD PTR DS:[ECX+8]					."\x0F\xAF\x41\x04"		// IMUL EAX,DWORD PTR DS:[ECX+4]					."\x8B\x51\x0C";		// MOV EDX,DWORD PTR DS:[ECX+C]		}		else {			$code =  "\x8B\x41\x08"			// MOV EAX,DWORD PTR DS:[ECX+8]					."\x0F\xAF\x41\x04"		// IMUL EAX,DWORD PTR DS:[ECX+4]					."\x03\x41\x0C";		// add     eax, [ecx+0Ch]			}				$repl =  "\xB8\x00\x00\x00\x00" // MOV EAX,0				."\xBA\x00\x00\x00\x00";// MOV EDX,0		        $offsets = $exe->matches($code, "\xAB");        if ($offsets === false) {            echo "Failed in part 1";            return false;        }                if(count($offsets) != 2) {            echo "Failed in part 2";            return false;        }        $exe->replace($offsets[0], array(0 => $repl));		$exe->replace($offsets[1], array(0 => $repl));        return true;    }?>